import getStringLabelKey from './getStringLabelKey';
describe('getStringLabelKey', function () {
  it('returns the specified string labelKey', function () {
    expect(getStringLabelKey('name')).toBe('name');
  });
  it('returns the default labelKey when `labelKey` is a function', function () {
    expect(getStringLabelKey(function (o) {
      return o.name;
    })).toBe('label');
  });
});